 15px;\" class=\"text-blue-color\">Regards, <br/>\n                                {{from_name}}\n                            </strong>','{{description}}, {{from_name}}','2022-10-04 06:43:43','2022-10-04 06:43:43'),(4,'Email Job To Friend','Email for Job Details',' <strong style=\"text-align: left;\" class=\"text-blue-color\">\n                                Hi {{friend_name}},\n                            </strong>\n                            <br/><br>\n                            I have send you the below job link in which you can find the relevant details for the same.\n                            <br/><br>\n                                Link : <a href=\"{{job_url}}\" target=\"_blank\">{{job_url}}</a>\n                            <br><br>\n                            <strong style=\"display: block; margin-top: 15px;\" class=\"text-blue-color\">Regards, <br/>\n                                {{from_name}}\n                            </strong>','{{friend_name}}, {{job_url}}, {{from_name}}','2022-10-04 06:43:43','2022-10-04 06:43:43'),(5,'Job Alert','New Job Alert','<strong style=\"text-align: left;\" class=\"text-blue-color\">\n                               Hi {{job_name}},\n                            </strong>\n                            <br/><br>\n                            <h2>Job Title: {{job_title}}</h2>\n                            <br/><br>\n                            New job posted with {{job_title}}, if you are interested then you can apply for this job.<br><br><br>\n                            <a href=\"{{job_url}}\" target=\"_blank\" style=\"display: table; margin: 0 auto;\">View Job</a>\n                            <br><br>\n                            <strong style=\"display: block; margin-top: 15px;\" class=\"text-blue-color\">Thanks, <br/>\n                                {{from_name}}\n                            </strong>','{{job_name}},{{job_url}}, {{job_title}}, {{from_name}}','2022-10-04 06:43:43','2022-10-04 06:43:43'),(6,'Candidate Job Applied','Job Applied by Candidate','<strong style=\"text-align: left;\" class=\"text-blue-color\">\n                                Hi {{employer_fullName}},\n                            </strong>\n                            <br/><br>\n                            <h2>Someone just applied for job : {{job_title}}</h2>\n                            <br/><br>\n                            My name is {{candidate_name}}<br><br>\n                            I have go through with your job details and thereby i have applied for the same. Please kindly contact me if i found suitable based on your needs.<br><br><br>\n                            <a href=\"{{candidate_details_url}}\" target=\"_blank\" style=\"display: table; margin: 0 auto;\">View Candidate Profile</a>\n                            <br><br>\n                            <strong style=\"display: block; margin-top: 15px;\" class=\"text-blue-color\">Regards, <br/>\n                                {{from_name}}\n                            </strong>','{{employer_fullName}},{{candidate_name}},{{candidate_details_url}}, {{job_title}}, {{from_name}}','2022-10-04 06:43:43','2022-10-04 06:43:43'),(7,'Verify Email','Verify Email Address','<strong style=\"text-align: left;\" class=\"text-blue-color\">\n                                Hello! {{user_name}},\n                            </strong>\n                            <br/><br>\n                            Please click the button below to verify your email address.\n                            <br/><br><br>\n                                <a href=\"{{verify_url}}\" style=\"display: table; margin: 0 auto;\">Verify Email Address</a>\n                            <br><br>\n                            If you did not create an account, no further action is required.<br><br>\n                            <strong style=\"display: block; margin-top: 15px;\" class=\"text-blue-color\">Regards, <br/>\n                                {{from_name}}\n                            </strong>','{{user_name}},{{verify_url}},{{from_name}}','2022-10-04 06:43:43','2022-10-04 06:43:43'),(8,'Password Reset Email','Notificación de restablecimiento de contraseña','<strong style=\"text-align: left;\" class=\"text-blue-color\">\r\n                                ¡Hola!\r\n                            </strong>\r\n                            <br/><br>\r\n                            Estás recibiendo este correo electrónico porque hemos recibido una solicitud de restablecimiento de contraseña para tu cuenta.\r\n                            <br/><br><br>\r\n                            <a href=\"{{reset_url}}\" style=\"display: table; margin: 0 auto;\">Restablecer contraseña</a>\r\n                            <br><br>\r\n                            Este enlace para restablecer la contraseña expirará en 60 minutos.<br><br>\r\n                            Si no solicitaste un restablecimiento de contraseña, no es necesario realizar ninguna acción adicional.<br><br>\r\n                            <strong style=\"display: block; margin-top: 15px;\" class=\"text-blue-color\">Saludos, <br/>\r\n                                \r\n                            </strong>\r\n','{{reset_url}},{{from_name}}','2022-10-04 06:43:43','2023-04-12 04:08:47');
